import React from 'react';
import { LineChart, Line, XAxis, YAxis, CartesianGrid, Tooltip, Legend, ResponsiveContainer } from 'recharts';
import { GrayScaleData, BrightnessBlock } from '../utils/dataParser';

interface DataVisualizationProps {
  grayScaleData: GrayScaleData;
  brightnessBlocks: BrightnessBlock[];
}

const DataVisualization: React.FC<DataVisualizationProps> = ({ grayScaleData, brightnessBlocks }) => {
  // 准备灰阶数据用于图表显示
  const grayScaleChartData = grayScaleData.values.map((value, index) => ({
    index: index + 1,
    value,
    position: grayScaleData.positions[index]
  }));

  // 渲染亮度数据块的矩阵热力图
  const renderBrightnessBlock = (block: BrightnessBlock, blockIndex: number) => {
    const flatData = block.data.flat();
    const maxValue = Math.max(...flatData);
    const minValue = Math.min(...flatData);
    const avgValue = flatData.reduce((a, b) => a + b, 0) / flatData.length;
    const nonZeroValues = flatData.filter(v => v !== 0);

    return (
      <div key={blockIndex} className="mb-8">
        <h3 className="text-lg font-semibold mb-4 text-gray-800">{block.label}</h3>
        <div className="bg-white p-4 rounded-lg shadow-md">
          {/* 矩阵热力图 */}
          <div className="mb-4">
            <h4 className="text-md font-medium mb-2 text-gray-700">矩阵热力图 (32列 × 20行)</h4>
            <div className="overflow-x-auto">
              <div className="inline-block min-w-full">
                {/* 列标题 */}
                <div className="flex mb-1">
                  <div className="w-8 h-6 flex items-center justify-center text-xs font-medium text-gray-500"></div>
                  {Array.from({ length: 32 }, (_, i) => (
                    <div key={i} className="w-6 h-6 flex items-center justify-center text-xs font-medium text-gray-500">
                      {String.fromCharCode(65 + i)}
                    </div>
                  ))}
                </div>
                {/* 矩阵数据 */}
                {block.data.map((row, rowIndex) => (
                  <div key={rowIndex} className="flex mb-px">
                    {/* 行标题 */}
                    <div className="w-8 h-6 flex items-center justify-center text-xs font-medium text-gray-500 bg-gray-50">
                      {block.startRow + rowIndex}
                    </div>
                    {/* 数据单元格 */}
                    {row.map((value, colIndex) => {
                      // 计算颜色强度 (0-1)
                      const intensity = maxValue > minValue ? (value - minValue) / (maxValue - minValue) : 0;
                      const backgroundColor = value === 0 
                        ? '#f8f9fa' 
                        : `rgba(59, 130, 246, ${0.2 + intensity * 0.8})`; // 蓝色渐变
                      const textColor = intensity > 0.5 ? '#ffffff' : '#1f2937';

                      return (
                        <div
                          key={`${rowIndex}-${colIndex}`}
                          className="w-6 h-6 flex items-center justify-center text-xs border border-gray-200 cursor-pointer hover:border-gray-400 transition-colors"
                          style={{ backgroundColor, color: textColor }}
                          title={`行: ${block.startRow + rowIndex}, 列: ${String.fromCharCode(65 + colIndex)}, 值: ${value.toFixed(6)}`}
                        >
                          {value !== 0 && (
                            <span className="font-mono" style={{ fontSize: '8px' }}>
                               {Math.abs(value) >= 1000 ? value.toExponential(2) : value.toFixed(2)}
                             </span>
                          )}
                        </div>
                      );
                    })}
                  </div>
                ))}
              </div>
            </div>
          </div>

          {/* 数据统计 */}
          <div className="grid grid-cols-2 md:grid-cols-4 gap-4 mt-4 p-3 bg-gray-50 rounded">
            <div className="text-center">
               <div className="text-xs text-gray-500">最小值</div>
               <div className="font-mono text-sm font-semibold">{minValue.toFixed(6)}</div>
             </div>
             <div className="text-center">
               <div className="text-xs text-gray-500">最大值</div>
               <div className="font-mono text-sm font-semibold">{maxValue.toFixed(6)}</div>
             </div>
             <div className="text-center">
               <div className="text-xs text-gray-500">平均值</div>
               <div className="font-mono text-sm font-semibold">{avgValue.toFixed(6)}</div>
             </div>
            <div className="text-center">
              <div className="text-xs text-gray-500">非零值</div>
              <div className="font-mono text-sm font-semibold">{nonZeroValues.length}/{flatData.length}</div>
            </div>
          </div>

          {/* 数值分布 */}
          <div className="mt-4">
            <h5 className="text-sm font-medium mb-2 text-gray-700">数值分布</h5>
            <div className="flex items-center space-x-2 text-xs">
              <div className="flex items-center">
                <div className="w-4 h-4 bg-gray-100 border border-gray-300 mr-1"></div>
                <span>零值</span>
              </div>
              <div className="flex items-center">
                <div className="w-4 h-4 bg-blue-200 border border-gray-300 mr-1"></div>
                <span>低值</span>
              </div>
              <div className="flex items-center">
                <div className="w-4 h-4 bg-blue-500 border border-gray-300 mr-1"></div>
                <span>中值</span>
              </div>
              <div className="flex items-center">
                <div className="w-4 h-4 bg-blue-800 border border-gray-300 mr-1"></div>
                <span>高值</span>
              </div>
            </div>
          </div>
        </div>
      </div>
    );
  };

  return (
    <div className="space-y-8">
      {/* 灰阶数据可视化 */}
      <div className="bg-white p-6 rounded-lg shadow-md">
        <h2 className="text-xl font-bold mb-4 text-gray-800">灰阶数据 (N维向量)</h2>
        <div className="mb-4">
          <p className="text-sm text-gray-600 mb-2">
            数据点数量: {grayScaleData.values.length} | 
            起始位置: B1 | 
            间隔: 每22个单元格
          </p>
        </div>

        {grayScaleData.values.length > 0 ? (
          <ResponsiveContainer width="100%" height={300}>
            <LineChart data={grayScaleChartData}>
              <CartesianGrid strokeDasharray="3 3" />
              <XAxis 
                dataKey="index" 
                label={{ value: '数据点索引', position: 'insideBottom', offset: -10 }}
              />
              <YAxis 
                label={{ value: '灰阶值', angle: -90, position: 'insideLeft' }}
              />
              <Tooltip 
                formatter={(value, name, props) => [
                  `值: ${value}`,
                  `位置: ${props.payload.position}`
                ]}
                labelFormatter={(index) => `数据点 ${index}`}
              />
              <Legend />
              <Line 
                type="monotone" 
                dataKey="value" 
                stroke="#8884d8" 
                strokeWidth={2}
                dot={{ fill: '#8884d8', strokeWidth: 2, r: 4 }}
                name="灰阶值"
              />
            </LineChart>
          </ResponsiveContainer>
        ) : (
          <div className="text-center py-8 text-gray-500">
            未找到灰阶数据
          </div>
        )}

        {/* 数据详情表格 */}
        {grayScaleData.values.length > 0 && (
          <div className="mt-6">
            <h3 className="text-lg font-semibold mb-3 text-gray-800">数据详情</h3>
            <div className="max-h-40 overflow-y-auto border rounded">
              <table className="w-full text-sm">
                <thead className="bg-gray-50 sticky top-0">
                  <tr>
                    <th className="px-4 py-2 text-left">索引</th>
                    <th className="px-4 py-2 text-left">位置</th>
                    <th className="px-4 py-2 text-left">值</th>
                  </tr>
                </thead>
                <tbody>
                  {grayScaleData.values.map((value, index) => (
                    <tr key={index} className="border-t hover:bg-gray-50">
                      <td className="px-4 py-2">{index + 1}</td>
                      <td className="px-4 py-2 font-mono">{grayScaleData.positions[index]}</td>
                      <td className="px-4 py-2 font-mono">{value.toFixed(6)}</td>
                    </tr>
                  ))}
                </tbody>
              </table>
            </div>
          </div>
        )}
      </div>

      {/* 亮度数据块可视化 */}
      <div>
        <h2 className="text-xl font-bold mb-6 text-gray-800">亮度数据块 (32×20 N维向量)</h2>
        {brightnessBlocks.length > 0 ? (
          brightnessBlocks.map((block, index) => renderBrightnessBlock(block, index))
        ) : (
          <div className="bg-white p-6 rounded-lg shadow-md text-center text-gray-500">
            未找到亮度数据块
          </div>
        )}
      </div>

      {/* 数据统计摘要 */}
      <div className="bg-white p-6 rounded-lg shadow-md">
        <h2 className="text-xl font-bold mb-4 text-gray-800">数据统计摘要</h2>
        <div className="grid grid-cols-1 md:grid-cols-3 gap-4">
          <div className="bg-blue-50 p-4 rounded-lg">
            <h3 className="font-semibold text-blue-800">灰阶数据</h3>
            <p className="text-sm text-blue-600 mt-1">
              数据点: {grayScaleData.values.length}
            </p>
            {grayScaleData.values.length > 0 && (
              <>
                <p className="text-sm text-blue-600">
                  平均值: {(grayScaleData.values.reduce((a, b) => a + b, 0) / grayScaleData.values.length).toFixed(2)}
                </p>
                <p className="text-sm text-blue-600">
                  范围: {Math.min(...grayScaleData.values).toFixed(2)} - {Math.max(...grayScaleData.values).toFixed(2)}
                </p>
              </>
            )}
          </div>

          <div className="bg-green-50 p-4 rounded-lg">
            <h3 className="font-semibold text-green-800">亮度数据块</h3>
            <p className="text-sm text-green-600 mt-1">
              数据块数量: {brightnessBlocks.length}
            </p>
            <p className="text-sm text-green-600">
              每块维度: 32 × 20
            </p>
            <p className="text-sm text-green-600">
              总数据点: {brightnessBlocks.length * 32 * 20}
            </p>
          </div>

          <div className="bg-purple-50 p-4 rounded-lg">
            <h3 className="font-semibold text-purple-800">解析配置</h3>
            <p className="text-sm text-purple-600 mt-1">
              灰阶起始: B1
            </p>
            <p className="text-sm text-purple-600">
              灰阶间隔: 22个单元格
            </p>
            <p className="text-sm text-purple-600">
              亮度块间隔: 22行
            </p>
          </div>
        </div>
      </div>
    </div>
  );
};

export default DataVisualization;
